import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Landing from "./pages/Landing";

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/" component={Landing} exact />
      </Switch>
    </Router>
  );
};

export default App;
